iki\/%D0%93%D0%B0%D0%BB%D0%B8%D1%86%D0%BA%D0%BE-%D0%92%D0%BE%D0%BB%D1%8B%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D0%BA%D0%BD%D1%8F%D0%B6%D0%B5%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0413\u0430\u043b\u0438\u0446\u043a\u043e-\u0412\u043e\u043b\u044b\u043d\u0441\u043a\u043e\u0435 \u043a\u043d\u044f\u0436\u0435\u0441\u0442\u0432\u043e\">\u0413\u0430\u043b\u0438\u0446\u043a\u043e-\u0412\u043e\u043b\u044b\u043d\u0441\u043a\u0438\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D0%BC%D0%B0%D0%BD_%D0%9C%D1%81%D1%82%D0%B8%D1%81%D0%BB%D0%B0%D0%B2%D0%B8%D1%87\" title=\"\u0420\u043e\u043c\u0430\u043d \u041c\u0441\u0442\u0438\u0441\u043b\u0430\u0432\u0438\u0447\">\u0420\u043e\u043c\u0430\u043d \u041c\u0441\u0442\u0438\u0441\u043b\u0430\u0432\u0438\u0447<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1324_%D0%B3%D0%BE%D0%B4\" title=\"1324 \u0433\u043e\u0434\">1324<\/a>&#160;\u2014 \u043a\u0430\u043f\u0438\u0442\u0443\u043b\u044f\u0446\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BB%D1%8C%D1%8F%D1%80%D0%B8\" title=\"\u041a\u0430\u043b\u044c\u044f\u0440\u0438\">\u041a\u0430\u043b\u044c\u044f\u0440\u0438<\/a>. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D0%B7%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u041f\u0438\u0437\u0430\u043d\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u041f\u0438\u0437\u0430<\/a> \u043f\u0435\u0440\u0435\u0434\u0430\u0451\u0442 \u043f\u0440\u0430\u0432\u0430 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D1%80%D0%B4%D0%B8%D0%BD%D0%B8%D1%8F\" title=\"\u0421\u0430\u0440\u0434\u0438\u043d\u0438\u044f\">\u0421\u0430\u0440\u0434\u0438\u043d\u0438\u044e<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D0%B0%D0%B3%D0%BE%D0%BD\" title=\"\u0410\u0440\u0430\u0433\u043e\u043d\">\u0410\u0440\u0430\u0433\u043e\u043d\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1739_%D0%B3%D0%BE%D0%B4\" title=\"1739 \u0433\u043e\u0434\">1739<\/a>&#160;\u2014 \u043a\u0430\u043f\u0438\u0442\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%BF%D0%B0%D0%BD%D0%B1%D0%B5%D1%80%D0%B3,_%D0%9C%D0%B0%D1%80%D1%82%D1%8B%D0%BD_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0428\u043f\u0430\u043d\u0431\u0435\u0440\u0433, \u041c\u0430\u0440\u0442\u044b\u043d \u041f\u0435\u0442\u0440\u043e\u0432\u0438\u0447\">\u041c\u0430\u0440\u0442\u044b\u043d \u0428\u043f\u0430\u043d\u0431\u0435\u0440\u0433<\/a> \u043d\u0430 \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d\u043d\u044b\u0445 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D1%83%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2_%D0%9A%D0%B0%D0%BC%D1%87%D0%B0%D1%82%D0%BA%D0%B0\" class=\"mw-redirect\" title=\"\u041f\u043e\u043b\u0443\u043e\u0441\u0442\u0440\u043e\u0432 \u041a\u0430\u043c\u0447\u0430\u0442\u043a\u0430\">\u041a\u0430\u043c\u0447\u0430\u0442\u043a\u0435<\/a> \u0441\u0443\u0434\u0430\u0445 \u0434\u043e\u0441\u0442\u0438\u0433 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u042f\u043f\u043e\u043d\u0438\u0438<\/a>, \u0433\u0434\u0435 \u043f\u043e \u043f\u0440\u0438\u043a\u0430\u0437\u0443 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u0440\u0438\u0446\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%BD%D0%B0_%D0%98%D0%BE%D0%B0%D0%BD%D0%BD%D0%BE%D0%B2%D0%BD%D0%B0\" title=\"\u0410\u043d\u043d\u0430 \u0418\u043e\u0430\u043d\u043d\u043e\u0432\u043d\u0430\">\u0410\u043d\u043d\u044b \u0418\u043e\u0430\u043d\u043d\u043e\u0432\u043d\u044b<\/a> \u043e\u0437\u043d\u0430\u043a\u043e\u043c\u0438\u043b\u0441\u044f \u0441 \u0435\u0451 \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u043c \u0441\u0442\u0440\u043e\u0435\u043c, \u043e\u0431\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043b \u043f\u043e\u0440\u0442\u044b \u0438 \u043f\u0440\u0435\u04