 href=\"https:\/\/ru.wikipedia.org\/wiki\/1865_%D0%B3%D0%BE%D0%B4\" title=\"1865 \u0433\u043e\u0434\">1865<\/a>&#160;\u2014 \u0433\u0435\u043d\u0435\u0440\u0430\u043b \u0430\u0440\u043c\u0438\u0438 \u0441\u0435\u0432\u0435\u0440\u044f\u043d <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%93%D1%80%D0%B0%D0%BD%D0%B6%D0%B5%D1%80,_%D0%93%D0%BE%D1%80%D0%B4%D0%BE%D0%BD&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0413\u0440\u0430\u043d\u0436\u0435\u0440, \u0413\u043e\u0440\u0434\u043e\u043d (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0413\u043e\u0440\u0434\u043e\u043d \u0413\u0440\u0430\u043d\u0436\u0435\u0440<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u0441\u0432\u043e\u0431\u043e\u0434\u0443 \u0440\u0430\u0431\u0430\u043c \u0432 \u0448\u0442\u0430\u0442\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D1%85%D0%B0%D1%81\" title=\"\u0422\u0435\u0445\u0430\u0441\">\u0422\u0435\u0445\u0430\u0441<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1899_%D0%B3%D0%BE%D0%B4\" title=\"1899 \u0433\u043e\u0434\">1899<\/a>&#160;\u2014 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u0443\u0442\u0432\u0435\u0440\u0436\u0434\u0451\u043d \u041c\u043e\u043d\u0435\u0442\u043d\u044b\u0439 \u0443\u0441\u0442\u0430\u0432, \u0437\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BD%D0%B5%D0%B6%D0%BD%D0%B0%D1%8F_%D1%80%D0%B5%D1%84%D0%BE%D1%80%D0%BC%D0%B0_%D0%B2_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8_1895%E2%80%941897_%D0%B3%D0%BE%D0%B4%D0%BE%D0%B2\" title=\"\u0414\u0435\u043d\u0435\u0436\u043d\u0430\u044f \u0440\u0435\u0444\u043e\u0440\u043c\u0430 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 1895\u20141897 \u0433\u043e\u0434\u043e\u0432\">\u0444\u0438\u043d\u0430\u043d\u0441\u043e\u0432\u043e\u0439 \u0440\u0435\u0444\u043e\u0440\u043c\u044b<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D1%82%